import React, { useState } from "react";
import { predictLoan } from "../api";

function LoanForm({ setResult }) {
  const [form, setForm] = useState({
    Gender: "Male",
    Married: "No",
    Dependents: "0",
    Education: "Graduate",
    Self_Employed: "No",
    Property_Area: "Urban",
    Credit_History: "1",
    ApplicantIncome: "",
    CoapplicantIncome: "",
    Loan_Amount_Term: "360",
    DesiredLoanAmount: "",
  });

  const [showLoanType, setShowLoanType] = useState(false);
  const [loanType, setLoanType] = useState("Home Loan");

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Prepare payload
      const payload = {
        ...form,
        ApplicantIncome: parseInt(form.ApplicantIncome) || 0,
        CoapplicantIncome: parseInt(form.CoapplicantIncome) || 0,
        Loan_Amount_Term: parseInt(form.Loan_Amount_Term) || 360,
        Credit_History: parseInt(form.Credit_History) || 1,
        DesiredLoanAmount: parseInt(form.DesiredLoanAmount) || 0,
      };

      const res = await predictLoan(payload);
      setResult(res.data);

      // Show loan type only if eligible
      if (res.data.eligible) setShowLoanType(true);
    } catch (err) {
      console.error(err.response?.data || err.message);
    }
  };

  const handleLoanTypeSubmit = async (e) => {
    e.preventDefault();
    try {
      const payload = {
        ...form,
        ApplicantIncome: parseInt(form.ApplicantIncome) || 0,
        CoapplicantIncome: parseInt(form.CoapplicantIncome) || 0,
        Loan_Amount_Term: parseInt(form.Loan_Amount_Term) || 360,
        Credit_History: parseInt(form.Credit_History) || 1,
        DesiredLoanAmount: parseInt(form.DesiredLoanAmount) || 0,
        LoanType: loanType,
      };

      const res = await predictLoan(payload);
      setResult(res.data);
    } catch (err) {
      console.error(err.response?.data || err.message);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit} className="loan-form" style={{ display: "grid", gap: "10px", maxWidth: "400px" }}>
        {/* All applicant fields */}
        <label>
          Gender:
          <select name="Gender" value={form.Gender} onChange={handleChange}>
            <option>Male</option>
            <option>Female</option>
          </select>
        </label>

        <label>
          Married:
          <select name="Married" value={form.Married} onChange={handleChange}>
            <option>No</option>
            <option>Yes</option>
          </select>
        </label>

        <label>
          Dependents:
          <select name="Dependents" value={form.Dependents} onChange={handleChange}>
            <option>0</option>
            <option>1</option>
            <option>2</option>
            <option>3+</option>
          </select>
        </label>

        <label>
          Education:
          <select name="Education" value={form.Education} onChange={handleChange}>
            <option>Graduate</option>
            <option>Not Graduate</option>
          </select>
        </label>

        <label>
          Self Employed:
          <select name="Self_Employed" value={form.Self_Employed} onChange={handleChange}>
            <option>No</option>
            <option>Yes</option>
          </select>
        </label>

        <label>
          Property Area:
          <select name="Property_Area" value={form.Property_Area} onChange={handleChange}>
            <option>Urban</option>
            <option>Semiurban</option>
            <option>Rural</option>
          </select>
        </label>

        <label>
          Credit History:
          <select name="Credit_History" value={form.Credit_History} onChange={handleChange}>
            <option value="1">Good</option>
            <option value="0">Bad</option>
          </select>
        </label>

        <label>
          Applicant Income:
          <input type="number" name="ApplicantIncome" value={form.ApplicantIncome} onChange={handleChange} />
        </label>

        <label>
          Coapplicant Income:
          <input type="number" name="CoapplicantIncome" value={form.CoapplicantIncome} onChange={handleChange} />
        </label>

        <label>
          Loan Amount Term (in months):
          <input type="number" name="Loan_Amount_Term" value={form.Loan_Amount_Term} onChange={handleChange} />
        </label>

        <label>
          Desired Loan Amount:
          <input type="number" name="DesiredLoanAmount" value={form.DesiredLoanAmount} onChange={handleChange} />
        </label>

        <button type="submit" style={{ marginTop: "10px" }}>Check Eligibility</button>
      </form>

      {/* Show LoanType dropdown only if eligible */}
      {showLoanType && (
        <form onSubmit={handleLoanTypeSubmit} style={{ marginTop: "20px", maxWidth: "400px" }}>
          <label>
            Select Loan Type:
            <select value={loanType} onChange={(e) => setLoanType(e.target.value)}>
              <option>Home Loan</option>
              <option>Car Loan</option>
              <option>Personal Loan</option>
            </select>
          </label>
          <button type="submit" style={{ marginTop: "10px" }}>Get Loan Offers</button>
        </form>
      )}
    </div>
  );
}

export default LoanForm;
